    ,TYPE1          VARCHAR(8) NOT NULL
    ,TYPE2          VARCHAR(8)
    ,COLOR          VARCHAR(14) NOT NULL
    ,ABILITY1       VARCHAR(16) NOT NULL
    ,ABILITY2       VARCHAR(16)
    ,ABILITY_HIDDEN VARCHAR(16)
